import React from "react";

export default function ContainerContact(item) {

    let freePlaces

    if (props.openSpots === 0) {
        freePlaces = "Sold out"

    }
    else {
        freePlaces = `Remaining ${props.openSpots} Places`

    }
    if (props.openSpots === 1) {
        freePlaces = `Remaining ${props.openSpots} Place`

    }

    return (


        <div className="containerContact">

            <img src={props.img} alt='Img' />
            {freePlaces && < div className="soldOut">{freePlaces}</div>}

            <section>

                <div className='containerContactImg'>
                    <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/2/29/Gold_Star.svg/1024px-Gold_Star.svg.png" alt='Img'></img>
                    <span> {props.rating}  </span>
                    <span> {props.name} </span>
                </div>

                <div className="containerContactInfo">
                    <div> {props.data} </div>
                    <div> {props.cost}   </div>
                </div>

            </section >
        </div >


    )
}
